  Header,
  Icon,
  Input,
  Image,
  Label,
  Menu,
  Table
} from "semantic-ui-react";

class App extends React.Component {
  render() {
    return (
      <div className="App">
        <Grid padded className="computer only">

        </Grid>
      </div>
    );
  }
}

export default App;
